DROP DATABASE PokeTcgDex
GO
CREATE DATABASE PokeTcgDex
GO
USE PokeTcgDex
GO
CREATE TABLE [Sets](
	[SetId] [int] IDENTITY(1,1) NOT NULL,
	[CollectionId] [int] NOT NULL,
	[SetName] [nvarchar](100) NOT NULL,
	 CONSTRAINT [Sets$PrimaryKey] PRIMARY KEY CLUSTERED 
(
	[SetId] ASC
)
)
GO
CREATE TABLE [Collections](
	[CollectionId] [int] IDENTITY(1,1) NOT NULL,
	[CollectionName] [nvarchar](100) NOT NULL,
	CONSTRAINT [Collections$PrimaryKey] PRIMARY KEY CLUSTERED
(
	[CollectionId] ASC
)
)
GO
CREATE TABLE [Energys](
	[EnergyId] [int] IDENTITY(1,1) NOT NULL,
	[EnergyName] [nvarchar](100) NOT NULL,
	CONSTRAINT [Energys$PrimaryKey] PRIMARY KEY CLUSTERED
(
	[EnergyId] ASC
)
)
GO
CREATE TABLE [KindOfCards](
	[KindOfCardId] [int] IDENTITY(1,1) NOT NULL,
	[KindOfCardName] [nvarchar](100) NOT NULL,
	CONSTRAINT [KindOfCards$PrimaryKey] PRIMARY KEY CLUSTERED
(
	[KindOfCardId] ASC
)
)
GO
CREATE TABLE [Raritys](
	[RarityId] [int] IDENTITY(1,1) NOT NULL,
	[RarityName] [nvarchar](30) NOT NULL,
	CONSTRAINT [Raritys$PrimaryKey] PRIMARY KEY CLUSTERED
(
	[RarityId] ASC
)
)
GO
CREATE TABLE [Cards](
	[CardId] [int] IDENTITY(1,1) NOT NULL,
	[SetId] [int] NOT NULL,
	[CardNr] [int] NOT NULL,
	[CardName] [nvarchar](100) NOT NULL,
	[ImageName] [nvarchar](10) NOT NULL,
	[EnergyId] [int] NOT NULL,
	[KindOfCardId] [int] NOT NULL,
	[RarityId] [int] NOT NULL,
	[InCollection] [bit] ,
	CONSTRAINT [Cards$PrimaryKey] PRIMARY KEY CLUSTERED
(
	[CardId] ASC
)
)
GO
ALTER TABLE [Cards] WITH NOCHECK ADD CONSTRAINT [Cards$SetsCards] FOREIGN KEY([SetId])
REFERENCES [Sets] ([SetId])
GO
ALTER TABLE [Cards] CHECK CONSTRAINT [Cards$SetsCards]
GO
ALTER TABLE [Cards] WITH NOCHECK ADD CONSTRAINT [Cards$EnergysCards] FOREIGN KEY([EnergyId])
REFERENCES [Energys] ([EnergyId])
GO
ALTER TABLE [Cards] CHECK CONSTRAINT [Cards$EnergysCards]
GO
ALTER TABLE [Cards] WITH NOCHECK ADD CONSTRAINT [Cards$KindOfCardsCards] FOREIGN KEY([KindOfCardId])
REFERENCES [KindOfCards] ([KindOfCardId])
GO
ALTER TABLE [Cards] CHECK CONSTRAINT [Cards$KindOfCardsCards]
GO
ALTER TABLE [Cards] WITH NOCHECK ADD CONSTRAINT [Cards$RaritysCards] FOREIGN KEY([RarityId])
REFERENCES [Raritys] ([RarityId])
GO
ALTER TABLE [Cards] CHECK CONSTRAINT [Cards$RaritysCards]
GO
ALTER TABLE [Sets] WITH NOCHECK ADD CONSTRAINT [Sets$CollectionsSets] FOREIGN KEY([CollectionId])
REFERENCES [Collections] ([CollectionId])
GO
